import React from 'react'
import TemperatureGraph from "./TemperatureGraphic/TemperatureGraph.js"

class Info extends React.Component {
    constructor(props){
      super(props)
    }

    render() {
        return (
            <InfoScreen cities={this.props.data.selectedCities}/> 
        )
    }
}
function InfoScreen(props) {
    if(props.cities.length > 2) {
        return (
            <div>
                <TemperatureGraph />
            </div>
        )
    } else {
        return null
    }
}
export default Info
